import Item from './Item'

const List = ({ listData, deleteData, submittingStatus  }) => {
    // console.log('listData', listData)
    return(
     <div className="list">
        {
            listData.map((item) =>{
            const{user,title, note, id} = item
            return( 
            <Item 
            key = {id} 
            id = {id}
            user = {user}
            title = {title}
            note = {note}  
            deleteData = {deleteData}
         
            />
            )
        })}
    </div>
    )
}
export default List
